import React from "react";
import Vegetable from "../../assets/Vegatables.jpg";
import Coffee from "../../assets/Coffee.jpg";
import Fruit from "../../assets/Fruite.jpg";
import Masalas from "../../assets/Masalas.jpg";
import Seeds from "../../assets/Seeds.jpg";
import dairy from "../../assets/Dairy.jpg";

function Menu() {
  return (
    <div className="w-full mt-10 px-4">
      {/* Title and Data */}
      <div>
        <h1>Menu</h1>
        <span>
          Choose Your Best Product and get direct delivery from your favorite
          FRAMERS
        </span>
      </div>
      {/* Responsive grid layout */}
      <div className="grid grid-cols-2 sm:grid-cols-2 md:grid-cols-4 lg:grid-cols-6 gap-4">
        {/* Circle Items */}
        <div className="rounded-full flex items-center justify-center text-white border-4 border-transparent hover:border-blue-700 hover:scale-105 transition-all duration-300">
          <div
            className="w-[150px] h-[150px] rounded-full bg-cover"
            style={{ backgroundImage: `url(${Vegetable})` }}
          />
        </div>
        <div className="rounded-full flex items-center justify-center text-white border-4 border-transparent hover:border-green-700 hover:scale-105 transition-all duration-300">
          <div
            className="w-[150px] h-[150px] rounded-full bg-cover"
            style={{ backgroundImage: `url(${Fruit})` }}
          />
        </div>
        <div className="rounded-full flex items-center justify-center text-white border-4 border-transparent hover:border-red-700 hover:scale-105 transition-all duration-300">
          <div
            className="w-[150px] h-[150px] rounded-full bg-cover"
            style={{ backgroundImage: `url(${dairy})` }}
          />
        </div>
        <div className="rounded-full flex items-center justify-center text-white border-4 border-transparent hover:border-yellow-700 hover:scale-105 transition-all duration-300">
          <div
            className="w-[150px] h-[150px] rounded-full bg-cover"
            style={{ backgroundImage: `url(${Seeds})` }}
          />
        </div>
        <div className="rounded-full flex items-center justify-center text-white border-4 border-transparent hover:border-purple-700 hover:scale-105 transition-all duration-300">
          <div
            className="w-[150px] h-[150px] rounded-full bg-cover"
            style={{ backgroundImage: `url(${Masalas})` }}
          />
        </div>
        <div className="rounded-full flex items-center justify-center text-white border-4 border-transparent hover:border-orange-700 hover:scale-105 transition-all duration-300">
          <div
            className="w-[150px] h-[150px] rounded-full bg-cover"
            style={{ backgroundImage: `url(${Coffee})` }}
          />
        </div>
      </div>
    </div>
  );
}

export default Menu;
